     *
     * This function call must use less than 30 000 gas.
     */
    function supportsInterface(bytes4 interfaceId) external view returns (bool);
}

contracts/DynamicPricing.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "../interfaces/IPriceOracle.sol";
import "./ReputationSystem.sol";

/**
 * @title DynamicPricing
 * @dev Implements dynamic pricing algorithm with demand-based multipliers and reputation discounts
 * Based on market conditions, utilization rates, and user reputation
 */
contract DynamicPricing is Ownable, ReentrancyGuard {

    struct PricingData {
        uint256 basePrice;
        uint256 utilizationRate; // Basis points (10000 = 100%)
        uint256 lastUpdate;
        uint256 rentalCount;
        uint256 totalRentalTime;
        uint256 rollingWindowStart;
    }

    struct CollectionPricing {
        uint256 floorPrice;
        uint256 averagePrice;
        uint256 lastSalePrice;
        uint256 rarityScore;
        uint256 lastUpdate;
    }

    // State variables
    mapping(address => mapping(uint256 => PricingData)) public nftPricingData;
    mapping(address => CollectionPricing) public collectionPricing;
    mapping(address => bool) public authorizedContracts;

    IPriceOracle public priceOracle;
    ReputationSystem public reputationSystem;

    // Pricing parameters
    uint256 public constant BASIS_POINTS = 10000;
    uint256 public constant HIGH_UTILIZATION_THRESHOLD = 8000; // 80%
    uint256 public constant LOW_UTILIZATION_THRESHOLD = 2000;  // 20%
    uint256 public constant ROLLING_WINDOW = 7 days;

    // Multipliers (in basis points)
    uint256 public highDemandMultiplier = 15000; // 1.5x
    uint256 public lowDemandMultiplier = 7500;   // 0.75x
    uint256 public maxMultiplier = 20000;        // 2.0x
    uint256 public minMultiplier = 5000;         // 0.5x

    // Reputation discounts (in basis points)
    uint256 public highReputationDiscount = 500;  // 5%
    uint256 public midReputationDiscount = 250;   // 2.5%
    uint256 public lowReputationDiscount = 100;   // 1%

    // Oracle-based pricing parameters
    uint256 public oraclePriceMultiplier = 11; // 0.000000011 (100% APR equivalent)
    uint256 public constant ORACLE_DIVISOR = 1000000000; // 1e9

    // Events
    event PricingDataUpdated(
        address indexed nftContract,
        uint256 indexed tokenId,
        uint256 newUtilizationRate,
        uint256 newPrice
    );

    event CollectionPricingUpdated(
        address indexed nftContract,
        uint256 floorPrice,
        uint256 averagePrice,
        uint256 lastSalePrice
    );

    event PricingParametersUpdated(
        uint256 highDemandMultiplier,
        uint256 lowDemandMultiplier,
        uint256 maxMultiplier,
        uint256 minMultiplier
    );

    modifier onlyAuthorized() {
        require(
            authorizedContracts[msg.sender] || 
            msg.sender == owner(),
            "Not authorized"
        );
        _;
    }

    constructor(address _priceOracle, address _reputationSystem) {
        priceOracle = IPriceOracle(_priceOracle);
        reputationSystem = ReputationSystem(_reputationSystem);
    }

    /**
     * @dev Get dynamic price for an NFT based on market conditions and user reputation
     * @param nftContract Address of the NFT contract
     * @param tokenId Token ID
     * @param basePrice Base price per second
     * @param user User address for reputation-based discounts
     * @return Dynamic price per second
     */
    function getDynamicPrice(
        address nftContract,
        uint256 tokenId,
        uint256 basePrice,
        address user
    ) external view returns (uint256) {
        // Start with base price
        uint256 dynamicPrice = basePrice;

        // Apply utilization-based multiplier
        uint256 utilizationMultiplier = _getUtilizationMultiplier(nftContract, tokenId);
        dynamicPrice = dynamicPrice * utilizationMultiplier / BASIS_POINTS;

        // Apply oracle-based pricing if available
        uint256 oraclePrice = _getOracleBasedPrice(nftContract, tokenId);
        if (oraclePrice > 0) {
            // Blend oracle price with current price (70% current, 30% oracle)
            dynamicPrice = (dynamicPrice * 7000 + oraclePrice * 3000) / BASIS_POINTS;
        }

        // Apply reputation-based discount
        uint256 reputationDiscount = _getReputationDiscount(user);
        if (reputationDiscount > 0) {
            dynamicPrice = dynamicPrice * (BASIS_POINTS - reputationDiscount) / BASIS_POINTS;
        }

        // Ensure price is within bounds
        uint256 minPrice = basePrice * minMultiplier / BASIS_POINTS;
        uint256 maxPrice = basePrice * maxMultiplier / BASIS_POINTS;

        if (dynamicPrice < minPrice) {
            dynamicPrice = minPrice;
        } else if (dynamicPrice > maxPrice) {
            dynamicPrice = maxPrice;
        }

        return dynamicPrice;
    }

    /**
     * @dev Update pricing data after a rental
     * @param nftContract Address of the NFT contract
     * @param tokenId Token ID
     * @param rentalDuration Duration of the rental in seconds
     * @param pricePerSecond Price per second of the rental
     */
    function updatePricingData(
        address nftContract,
        uint256 tokenId,
        uint256 rentalDuration,
        uint256 pricePerSecond
    ) external onlyAuthorized {
        PricingData storage data = nftPricingData[nftContract][tokenId];

        // Update rolling window if needed
        if (block.timestamp - data.rollingWindowStart > ROLLING_WINDOW) {
            data.rollingWindowStart = block.timestamp - ROLLING_WINDOW;
            data.rentalCount = 0;
            data.totalRentalTime = 0;
        }

        // Update rental statistics
        data.rentalCount++;
        data.totalRentalTime += rentalDuration;
        data.lastUpdate = block.timestamp;

        // Calculate utilization rate
        uint256 windowDuration = block.timestamp - data.rollingWindowStart;
        if (windowDuration > 0) {
            data.utilizationRate = (data.totalRentalTime * BASIS_POINTS) / windowDuration;
        }

        emit PricingDataUpdated(nftContract, tokenId, data.utilizationRate, pricePerSecond);
    }

    /**
     * @dev Update collection pricing data from oracle
     * @param nftContract Address of the NFT contract
     */
    function updateCollectionPricing(address nftContract) external onlyAuthorized {
        try priceOracle.getFloorPrice(nftContract) returns (uint256 floorPrice) {
            try priceOracle.getAveragePrice(nftContract) returns (uint256 averagePrice) {
                try priceOracle.getLastSalePrice(nftContract) returns (uint256 lastSalePrice) {
                    collectionPricing[nftContract] = CollectionPricing({
                        floorPrice: floorPrice,
                        averagePrice: averagePrice,
                        lastSalePrice: lastSalePrice,
                        rarityScore: 0, // Would need additional oracle for rarity
                        lastUpdate: block.timestamp
                    });

                    emit CollectionPricingUpdated(nftContract, floorPrice, averagePrice, lastSalePrice);
                } catch {
                    // Handle oracle failure gracefully
                }
            } catch {
                // Handle oracle failure gracefully
            }
        } catch {
            // Handle oracle failure gracefully
        }
    }

    /**
     * @dev Get utilization-based price multiplier
     */
    function _getUtilizationMultiplier(
        address nftContract,
        uint256 tokenId
    ) internal view returns (uint256) {
        PricingData memory data = nftPricingData[nftContract][tokenId];

        if (data.utilizationRate >= HIGH_UTILIZATION_THRESHOLD) {
            return highDemandMultiplier;
        } else if (data.utilizationRate <= LOW_UTILIZATION_THRESHOLD) {
            return lowDemandMultiplier;
        } else {
            // Linear interpolation between thresholds
            uint256 range = HIGH_UTILIZATION_THRESHOLD - LOW_UTILIZATION_THRESHOLD;
            uint256 position = data.utilizationRate - LOW_UTILIZATION_THRESHOLD;
            uint256 multiplierRange = highDemandMultiplier - lowDemandMultiplier;

            return lowDemandMultiplier + (multiplierRange * position / range);
        }
    }

    /**
     * @dev Get oracle-based price suggestion
     */
    function _getOracleBasedPrice(
        address nftContract,
        uint256 /* tokenId */
    ) internal view returns (uint256) {
        CollectionPricing memory collection = collectionPricing[nftContract];

        // Use last sale price if available, otherwise use average price
        uint256 referencePrice = collection.lastSalePrice > 0 
            ? collection.lastSalePrice 
            : collection.averagePrice;

        if (referencePrice == 0) {
            return 0;
        }

        // Calculate suggested price: (OraclePrice * 0.000000011) / 3600
        // This suggests a rate that would equate to 100% APR if rented continuously
        return (referencePrice * oraclePriceMultiplier) / (ORACLE_DIVISOR * 3600);
    }

    /**
     * @dev Get reputation-based discount
     */
    function _getReputationDiscount(address user) internal view returns (uint256) {
        if (address(reputationSystem) == address(0)) {
            return 0;
        }

        try reputationSystem.getUserReputation(user) returns (ReputationSystem.UserReputation memory reputation) {
            if (reputation.reputationScore >= 800) {
                return highReputationDiscount;
            } else if (reputation.reputationScore >= 500) {
                return midReputationDiscount;
            } else if (reputation.reputationScore >= 100) {
                return lowReputationDiscount;
            }
        } catch {
            // Handle reputation system failure gracefully
        }

        return 0;
    }

    /**
     * @dev Get current utilization rate for an NFT
     */
    function getUtilizationRate(address nftContract, uint256 tokenId) external view returns (uint256) {
        return nftPricingData[nftContract][tokenId].utilizationRate;
    }

    /**
     * @dev Get pricing data for an NFT
     */
    function getPricingData(address nftContract, uint256 tokenId) external view returns (PricingData memory) {
        return nftPricingData[nftContract][tokenId];
    }

    /**
     * @dev Get collection pricing data
     */
    function getCollectionPricing(address nftContract) external view returns (CollectionPricing memory) {
        return collectionPricing[nftContract];
    }

    /**
     * @dev Check if an NFT has high utility demand
     */
    function hasHighUtilityDemand(address nftContract, uint256 tokenId) external view returns (bool) {
        return nftPricingData[nftContract][tokenId].utilizationRate >= HIGH_UTILIZATION_THRESHOLD;
    }

    /**
     * @dev Get suggested price based on oracle data
     */
    function getSuggestedPrice(address nftContract, uint256 /* tokenId */) external view returns (uint256) {
        return _getOracleBasedPrice(nftContract, 0);
    }

    /**
     * @dev Update pricing parameters (only owner)
     */
    function updatePricingParameters(
        uint256 _highDemandMultiplier,
        uint256 _lowDemandMultiplier,
        uint256 _maxMultiplier,
        uint256 _minMultiplier
    ) external onlyOwner {
        require(_maxMultiplier >= _minMultiplier, "Invalid multiplier range");
        require(_highDemandMultiplier >= _lowDemandMultiplier, "Invalid demand multiplier range");

        highDemandMultiplier = _highDemandMultiplier;
        lowDemandMultiplier = _lowDemandMultiplier;
        maxMultiplier = _maxMultiplier;
        minMultiplier = _minMultiplier;

        emit PricingParametersUpdated(_highDemandMultiplier, _lowDemandMultiplier, _maxMultiplier, _minMultiplier);
    }

    /**
     * @dev Update reputation discount percentages
     */
    function updateReputationDiscounts(
        uint256 _highReputationDiscount,
        uint256 _midReputationDiscount,
        uint256 _lowReputationDiscount
    ) external onlyOwner {
        require(_highReputationDiscount <= 1000, "Discount too high"); // Max 10%
        require(_midReputationDiscount <= 1000, "Discount too high");
        require(_lowReputationDiscount <= 1000, "Discount too high");

        highReputationDiscount = _highReputationDiscount;
        midReputationDiscount = _midReputationDiscount;
        lowReputationDiscount = _lowReputationDiscount;
    }

    /**
     * @dev Update oracle price multiplier
     */
    function updateOraclePriceMultiplier(uint256 _multiplier) external onlyOwner {
        require(_multiplier > 0, "Multiplier must be positive");
        oraclePriceMultiplier = _multiplier;
    }

    /**
     * @dev Add authorized contract
     */
    function addAuthorizedContract(address contractAddr) external onlyOwner {
        authorizedContracts[contractAddr] = true;
    }

    /**
     * @dev Remove authorized contract
     */
    function removeAuthorizedContract(address contractAddr) external onlyOwner {
        authorizedContracts[contractAddr] = false;
    }

    /**
     * @dev Update price oracle address
     */
    function updatePriceOracle(address _priceOracle) external onlyOwner {
        require(_priceOracle != address(0), "Invalid oracle address");
        priceOracle = IPriceOracle(_priceOracle);
    }

    /**
     * @dev Update reputation system address
     */
    function updateReputationSystem(address _reputationSystem) external onlyOwner {
        reputationSystem = ReputationSystem(_reputationSystem);
    }

    /**
     * @dev Get comprehensive pricing information for an NFT
     */
    function getComprehensivePricing(
        address nftContract,
        uint256 tokenId,
        uint256 basePrice,
        address user
    ) external view returns (
        uint256 dynamicPrice,
        uint256 utilizationRate,
        uint256 utilizationMultiplier,
        uint256 oraclePrice,
        uint256 reputationDiscount,
        uint256 finalPrice
    ) {
        PricingData memory data = nftPricingData[nftContract][tokenId];
        utilizationRate = data.utilizationRate;
        utilizationMultiplier = _getUtilizationMultiplier(nftContract, tokenId);
        oraclePrice = _getOracleBasedPrice(nftContract, tokenId);
        reputationDiscount = _getReputationDiscount(user);

        // Calculate final price
        dynamicPrice = basePrice * utilizationMultiplier / BASIS_POINTS;

        if (oraclePrice > 0) {
            dynamicPrice = (dynamicPrice * 7000 + oraclePrice * 3000) / BASIS_POINTS;
        }

        if (reputationDiscount > 0) {
            dynamicPrice = dynamicPrice * (BASIS_POINTS - reputationDiscount) / BASIS_POINTS;
        }

        // Apply bounds
        uint256 minPrice = basePrice * minMultiplier / BASIS_POINTS;
        uint256 maxPrice = basePrice * maxMultiplier / BASIS_POINTS;

        if (dynamicPrice < minPrice) {
            finalPrice = minPrice;
        } else if (dynamicPrice > maxPrice) {
            finalPrice = maxPrice;
        } else {
            finalPrice = dynamicPrice;
        }
    }
}

contracts/NFTFlow.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/utils/introspection/IERC165.sol";
import "../interfaces/IERC4907.sol";
import "../interfaces/IPriceOracle.sol";

/**
 * @title NFTFlow
 * @dev Main contract for NFT rental marketplace on Somnia Network
 * Enables micro-rentals with real-time payment streaming
 */
contract NFTFlow is ReentrancyGuard, Pausable, Ownable {

    // Struct to represent a rental
    struct Rental {
        address nftContract;
        uint256 tokenId;
        address owner;
        address renter;
        uint256 pricePerSecond;
        uint256 startTime;
        uint256 endTime;
        uint256 collateralAmount;
        bool active;
        bool completed;
    }

    // Struct for rental listings
    struct RentalListing {
        address nftContract;
        uint256 tokenId;
        address owner;
        uint256 pricePerSecond;
        uint256 minRentalDuration;
        uint256 maxRentalDuration;
        uint256 collateralRequired;
        bool active;
    }

    // State variables
    mapping(uint256 => Rental) public rentals;
    mapping(bytes32 => RentalListing) public listings;
    mapping(address => uint256[]) public userRentals;
    mapping(address => uint256[]) public ownerListings;
    mapping(address => uint256) public userCollateralBalance;

    uint256 public nextRentalId;
    uint256 public platformFeePercentage = 250; // 2.5%
    uint256 public constant MAX_RENTAL_DURATION = 30 days;
    uint256 public constant MIN_RENTAL_DURATION = 1; // 1 second

    address public paymentStreamContract;
    address public reputationContract;
    address public utilityTrackerContract;
    IPriceOracle public priceOracle;

    // Events
    event RentalListed(
        bytes32 indexed listingId,
        address indexed nftContract,
        uint256 indexed tokenId,
        address owner,
        uint256 pricePerSecond
    );

    event RentalCreated(
        uint256 indexed rentalId,
        address indexed nftContract,
        uint256 indexed tokenId,
        address owner,
        address renter,
        uint256 duration,
        uint256 totalCost
    );

    event RentalCompleted(
        uint256 indexed rentalId,
        address indexed renter,
        bool successful
    );

    event CollateralDeposited(
        address indexed user,
        uint256 amount
    );

    event CollateralWithdrawn(
        address indexed user,
        uint256 amount
    );

    constructor(
        address _priceOracle,
        address _paymentStreamContract,
        address _reputationContract,
        address _utilityTrackerContract
    ) {
        priceOracle = IPriceOracle(_priceOracle);
        paymentStreamContract = _paymentStreamContract;
        reputationContract = _reputationContract;
        utilityTrackerContract = _utilityTrackerContract;
    }

    /**
     * @dev List an NFT for rental
     * @param nftContract Address of the NFT contract
     * @param tokenId Token ID to list
     * @param pricePerSecond Price per second in wei
     * @param minDuration Minimum rental duration in seconds
     * @param maxDuration Maximum rental duration in seconds
     * @param collateralRequired Collateral amount required from renter
     */
    function listForRental(
        address nftContract,
        uint256 tokenId,
        uint256 pricePerSecond,
        uint256 minDuration,
        uint256 maxDuration,
        uint256 collateralRequired
    ) external nonReentrant whenNotPaused {
        require(IERC721(nftContract).ownerOf(tokenId) == msg.sender, "Not token owner");
        require(IERC721(nftContract).isApprovedForAll(msg.sender, address(this)), "Contract not approved");
        require(pricePerSecond > 0, "Price must be greater than 0");
        require(minDuration >= MIN_RENTAL_DURATION, "Duration too short");
        require(maxDuration <= MAX_RENTAL_DURATION, "Duration too long");
        require(minDuration <= maxDuration, "Invalid duration range");

        bytes32 listingId = keccak256(abi.encodePacked(nftContract, tokenId, msg.sender, block.timestamp));

        listings[listingId] = RentalListing({
            nftContract: nftContract,
            tokenId: tokenId,
            owner: msg.sender,
            pricePerSecond: pricePerSecond,
            minRentalDuration: minDuration,
            maxRentalDuration: maxDuration,
            collateralRequired: collateralRequired,
            active: true
        });

        ownerListings[msg.sender].push(uint256(listingId));

        emit RentalListed(listingId, nftContract, tokenId, msg.sender, pricePerSecond);
    }

    /**
     * @dev Rent an NFT for a specified duration
     * @param listingId The listing ID to rent
     * @param duration Duration in seconds
     */
    function rentNFT(
        bytes32 listingId,
        uint256 duration
    ) external payable nonReentrant whenNotPaused {
        RentalListing storage listing = listings[listingId];
        require(listing.active, "Listing not active");
        require(duration >= listing.minRentalDuration, "Duration too short");
        require(duration <= listing.maxRentalDuration, "Duration too long");

        uint256 totalCost = listing.pricePerSecond * duration;
        uint256 platformFee = totalCost * platformFeePercentage / 10000;
        uint256 ownerPayment = totalCost - platformFee;

        require(msg.value >= totalCost + listing.collateralRequired, "Insufficient payment");

        // Check if user has sufficient collateral balance or reputation
        uint256 requiredCollateral = listing.collateralRequired;
        if (reputationContract != address(0)) {
            // Reduce collateral based on reputation (simplified)
            requiredCollateral = requiredCollateral / 2;
        }

        require(
            userCollateralBalance[msg.sender] + msg.value >= requiredCollateral,
            "Insufficient collateral"
        );

        uint256 rentalId = nextRentalId++;
        uint256 startTime = block.timestamp;
        uint256 endTime = startTime + duration;

        rentals[rentalId] = Rental({
            nftContract: listing.nftContract,
            tokenId: listing.tokenId,
            owner: listing.owner,
            renter: msg.sender,
            pricePerSecond: listing.pricePerSecond,
            startTime: startTime,
            endTime: endTime,
            collateralAmount: listing.collateralRequired,
            active: true,
            completed: false
        });

        userRentals[msg.sender].push(rentalId);

        // Set user for ERC-4907 compatible NFTs
        if (supportsInterface(listing.nftContract, type(IERC4907).interfaceId)) {
            IERC4907(listing.nftContract).setUser(listing.tokenId, msg.sender, uint64(endTime));
        }

        // Transfer payment to owner
        payable(listing.owner).transfer(ownerPayment);

        // Store collateral
        userCollateralBalance[msg.sender] = userCollateralBalance[msg.sender] + listing.collateralRequired;

        // Deactivate listing temporarily
        listing.active = false;

        emit RentalCreated(rentalId, listing.nftContract, listing.tokenId, listing.owner, msg.sender, duration, totalCost);
    }

    /**
     * @dev Complete a rental and handle collateral return
     * @param rentalId The rental ID to complete
     */
    function completeRental(uint256 rentalId) external nonReentrant {
        Rental storage rental = rentals[rentalId];
        require(rental.active, "Rental not active");
        require(block.timestamp >= rental.endTime, "Rental not expired");
        require(msg.sender == rental.renter || msg.sender == rental.owner, "Not authorized");

        rental.active = false;
        rental.completed = true;

        // Return collateral to renter
        if (rental.collateralAmount > 0) {
            userCollateralBalance[rental.renter] = userCollateralBalance[rental.renter] - rental.collateralAmount;
            payable(rental.renter).transfer(rental.collateralAmount);
        }

        // Clear user for ERC-4907 compatible NFTs
        if (supportsInterface(rental.nftContract, type(IERC4907).interfaceId)) {
            IERC4907(rental.nftContract).setUser(rental.tokenId, address(0), 0);
        }

        // Record utility usage for analytics
        if (utilityTrackerContract != address(0)) {
            uint256 duration = rental.endTime - rental.startTime;
            uint256 utilityValue = rental.pricePerSecond * duration; // Use payment as utility value proxy

            // Call utility tracker to record usage (simplified - assumes utility type 0 for gaming)
            (bool success, ) = utilityTrackerContract.call(
                abi.encodeWithSignature(
                    "recordUtilityUsage(address,uint256,address,uint256,uint256,uint256,uint256)",
                    rental.nftContract,
                    rental.tokenId,
                    rental.renter,
                    rental.startTime,
                    rental.endTime,
                    0, // Gaming utility type
                    utilityValue
                )
            );
            // Continue even if utility tracking fails
            success; // Silence unused variable warning
        }

        // Reactivate listing
        bytes32 listingId = keccak256(abi.encodePacked(rental.nftContract, rental.tokenId, rental.owner));
        if (listings[listingId].owner == rental.owner) {
            listings[listingId].active = true;
        }

        emit RentalCompleted(rentalId, rental.renter, true);
    }

    /**
     * @dev Deposit collateral for future rentals
     */
    function depositCollateral() external payable {
        require(msg.value > 0, "Must deposit some amount");
        userCollateralBalance[msg.sender] = userCollateralBalance[msg.sender] + msg.value;
        emit CollateralDeposited(msg.sender, msg.value);
    }

    /**
     * @dev Withdraw available collateral
     * @param amount Amount to withdraw
     */
    function withdrawCollateral(uint256 amount) external nonReentrant {
        require(userCollateralBalance[msg.sender] >= amount, "Insufficient balance");
        userCollateralBalance[msg.sender] = userCollateralBalance[msg.sender] - amount;
        payable(msg.sender).transfer(amount);
        emit CollateralWithdrawn(msg.sender, amount);
    }

    /**
     * @dev Get rental details
     * @param rentalId The rental ID
     * @return Rental struct
     */
    function getRental(uint256 rentalId) external view returns (Rental memory) {
        return rentals[rentalId];
    }

    /**
     * @dev Get listing details
     * @param listingId The listing ID
     * @return RentalListing struct
     */
    function getListing(bytes32 listingId) external view returns (RentalListing memory) {
        return listings[listingId];
    }

    /**
     * @dev Check if a contract supports an interface
     * @param contractAddr Contract address to check
     * @param interfaceId Interface ID to check
     * @return True if supported
     */
    function supportsInterface(address contractAddr, bytes4 interfaceId) internal view returns (bool) {
        try IERC165(contractAddr).supportsInterface(interfaceId) returns (bool supported) {
            return supported;
        } catch {
            return false;
        }
    }

    /**
     * @dev Emergency pause function
     */
    function pause() external onlyOwner {
        _pause();
    }

    /**
     * @dev Unpause function
     */
    function unpause() external onlyOwner {
        _unpause();
    }

    /**
     * @dev Update platform fee
     * @param newFeePercentage New fee percentage (in basis points)
     */
    function updatePlatformFee(uint256 newFeePercentage) external onlyOwner {
        require(newFeePercentage <= 1000, "Fee too high"); // Max 10%
        platformFeePercentage = newFeePercentage;
    }

    /**
     * @dev Withdraw platform fees
     */
    function withdrawPlatformFees() external onlyOwner {
        payable(owner()).transfer(address(this).balance);
    }

    /**
     * @dev Get utility-based pricing recommendation for an NFT
     * @param nftContract Address of the NFT contract
     * @param tokenId Token ID
     * @param basePrice Base price per second
     * @return Recommended price per second based on utility analytics
     */
    function getUtilityBasedPrice(
        address nftContract,
        uint256 tokenId,
        uint256 basePrice
    ) external view returns (uint256) {
        if (utilityTrackerContract == address(0)) {
            return basePrice;
        }

        (bool success, bytes memory data) = utilityTrackerContract.staticcall(
            abi.encodeWithSignature(
                "getUtilityBasedPrice(address,uint256,uint256)",
                nftContract,
                tokenId,
                basePrice
            )
        );

        if (success && data.length > 0) {
            return abi.decode(data, (uint256));
        }

        return basePrice;
    }

    /**
     * @dev Check if an NFT has high utility demand
     * @param nftContract Address of the NFT contract
     * @param tokenId Token ID
     * @return True if NFT has high utility demand
     */
    function hasHighUtilityDemand(address nftContract, uint256 tokenId) external view returns (bool) {
        if (utilityTrackerContract == address(0)) {
            return false;
        }

        (bool success, bytes memory data) = utilityTrackerContract.staticcall(
            abi.encodeWithSignature(
                "hasHighUtilityDemand(address,uint256)",
                nftContract,
                tokenId
            )
        );

        if (success && data.length > 0) {
            return abi.decode(data, (bool));
        }

        return false;
    }
}

contracts/NFTFlowCore.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/utils/introspection/IERC165.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/security/ReentrancyGuardUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/security/PausableUpgradeable.sol";
import "../interfaces/IERC4907.sol";
import "../interfaces/IPriceOracle.sol";
import "./PaymentStream.sol";
import "./ReputationSystem.sol";
import "./DynamicPricing.sol";

/**
 * @title NFTFlowCore
 * @dev Core contract implementing the NFTFlow Protocol rental lifecycle state machine
 * Manages the complete rental process from listing to completion/cancellation
 */
contract NFTFlowCore is 
    Initializable,
    UUPSUpgradeable,
    OwnableUpgradeable,
    ReentrancyGuardUpgradeable,
    PausableUpgradeable 
{
    // Rental states following the state machine
    enum RentalState {
        LISTED,     // NFT is listed for rental
        RENTED,     // Rental has been initiated
        ACTIVE,     // Rental is in progress
        COMPLETED,  // Rental completed successfully
        CANCELLED   // Rental was cancelled
    }

    // Struct representing a rental with complete state information
    struct Rental {
        address nftContract;
        uint256 tokenId;
        address owner;
        address renter;
        uint256 pricePerSecond;
        uint256 startTime;
        uint256 endTime;
        uint256 collateralAmount;
        uint256 streamId;
        RentalState state;
        uint256 createdAt;
        uint256 lastUpdated;
    }

    // Struct for rental listings with enhanced parameters
    struct RentalListing {
        address nftContract;
        uint256 tokenId;
        address owner;
        uint256 pricePerSecond;
        uint256 minRentalDuration;
        uint256 maxRentalDuration;
        uint256 collateralMultiplier; // Basis points (10000 = 100%)
        bool active;
        uint256 createdAt;
        uint256 lastPriceUpdate;
    }

    // State variables
    mapping(uint256 => Rental) public rentals;
    mapping(bytes32 => RentalListing) public listings;
    mapping(address => uint256[]) public userRentals;
    mapping(address => uint256[]) public ownerListings;
    mapping(address => uint256) public userCollateralBalance;

    uint256 public nextRentalId;
    uint256 public platformFeePercentage = 250; // 2.5% in basis points
    uint256 public creatorRoyaltyPercentage = 50; // 0.5% of total rental in basis points
    uint256 public constant MAX_RENTAL_DURATION = 30 days;
    uint256 public constant MIN_RENTAL_DURATION = 1; // 1 second
    uint256 public constant BASIS_POINTS = 10000;

    // Contract addresses
    address public paymentStreamContract;
    address public reputationContract;
    address public dynamicPricingContract;
    address public utilityTrackerContract;
    IPriceOracle public priceOracle;

    // Treasury and creator royalty addresses
    address public treasury;
    mapping(address => address) public collectionCreators; // NFT contract => creator address

    // Upgrade timelock
    uint256 public upgradeTimelock = 7 days;
    uint256 public proposedUpgradeTime;
    address public proposedImplementation;

    // Events for the state machine
    event RentalListed(
        bytes32 indexed listingId,
        address indexed nftContract,
        uint256 indexed tokenId,
        address owner,
        uint256 pricePerSecond,
        uint256 collateralMultiplier
    );

    event RentalStarted(
        uint256 indexed rentalId,
        address indexed nftContract,
        uint256 indexed tokenId,
        address owner,
        address renter,
        uint256 duration,
        uint256 totalCost,
        uint256 streamId
    );

    event RentalCompleted(
        uint256 indexed rentalId,
        address indexed renter,
        bool successful,
        uint256 totalPaid
    );

    event RentalCancelled(
        uint256 indexed rentalId,
        address indexed cancelledBy,
        string reason,
        uint256 refundAmount
    );

    event CollateralDeposited(
        address indexed user,
        uint256 amount
    );

    event CollateralWithdrawn(
        address indexed user,
        uint256 amount
    );

    event CreatorRoyaltySet(
        address indexed nftContract,
        address indexed creator
    );

    event UpgradeProposed(
        address indexed newImplementation,
        uint256 upgradeTime
    );

    event UpgradeExecuted(
        address indexed newImplementation
    );

    // Modifiers
    modifier onlyAuthorized() {
        require(
            msg.sender == owner() || 
            msg.sender == paymentStreamContract ||
            msg.sender == reputationContract,
            "Not authorized"
        );
        _;
    }

    modifier onlyAfterTimelock() {
        require(
            proposedUpgradeTime > 0 && 
            block.timestamp >= proposedUpgradeTime,
            "Upgrade timelock not expired"
        );
        _;
    }

    /**
     * @dev Initialize the contract (for proxy pattern)
     */
    function initialize(
        address _priceOracle,
        address _paymentStreamContract,
        address _reputationContract,
        address _dynamicPricingContract,
        address _utilityTrackerContract,
        address _treasury
    ) public initializer {
        __Ownable_init();
        __ReentrancyGuard_init();
        __Pausable_init();
        __UUPSUpgradeable_init();

        priceOracle = IPriceOracle(_priceOracle);
        paymentStreamContract = _paymentStreamContract;
        reputationContract = _reputationContract;
        dynamicPricingContract = _dynamicPricingContract;
        utilityTrackerContract = _utilityTrackerContract;
        treasury = _treasury;
    }

    /**
     * @dev List an NFT for rental with dynamic pricing support
     * @param nftContract Address of the NFT contract
     * @param tokenId Token ID to list
     * @param basePricePerSecond Base price per second in wei
     * @param minDuration Minimum rental duration in seconds
     * @param maxDuration Maximum rental duration in seconds
     * @param collateralMultiplier Collateral multiplier in basis points
     */
    function listForRental(
        address nftContract,
        uint256 tokenId,
        uint256 basePricePerSecond,
        uint256 minDuration,
        uint256 maxDuration,
        uint256 collateralMultiplier
    ) external nonReentrant whenNotPaused {
        require(IERC721(nftContract).ownerOf(tokenId) == msg.sender, "Not token owner");
        require(IERC721(nftContract).isApprovedForAll(msg.sender, address(this)), "Contract not approved");
        require(basePricePerSecond > 0, "Price must be greater than 0");
        require(minDuration >= MIN_RENTAL_DURATION, "Duration too short");
        require(maxDuration <= MAX_RENTAL_DURATION, "Duration too long");
        require(minDuration <= maxDuration, "Invalid duration range");
        require(collateralMultiplier <= 20000, "Collateral multiplier too high"); // Max 200%

        bytes32 listingId = keccak256(abi.encodePacked(nftContract, tokenId, msg.sender, block.timestamp));

        listings[listingId] = RentalListing({
            nftContract: nftContract,
            tokenId: tokenId,
            owner: msg.sender,
            pricePerSecond: basePricePerSecond,
            minRentalDuration: minDuration,
            maxRentalDuration: maxDuration,
            collateralMultiplier: collateralMultiplier,
            active: true,
            createdAt: block.timestamp,
            lastPriceUpdate: block.timestamp
        });

        ownerListings[msg.sender].push(uint256(listingId));

        emit RentalListed(listingId, nftContract, tokenId, msg.sender, basePricePerSecond, collateralMultiplier);
    }

    /**
     * @dev Rent an NFT with enhanced security and dynamic pricing
     * @param listingId The listing ID to rent
     * @param duration Duration in seconds
     */
    function rentNFT(
        bytes32 listingId,
        uint256 duration
    ) external payable nonReentrant whenNotPaused {
        RentalListing storage listing = listings[listingId];
        require(listing.active, "Listing not active");
        require(duration >= listing.minRentalDuration, "Duration too short");
        require(duration <= listing.maxRentalDuration, "Duration too long");

        // Get dynamic price if available
        uint256 finalPricePerSecond = listing.pricePerSecond;
        if (dynamicPricingContract != address(0)) {
            try IDynamicPricing(dynamicPricingContract).getDynamicPrice(
                listing.nftContract,
                listing.tokenId,
                listing.pricePerSecond,
                msg.sender
            ) returns (uint256 dynamicPrice) {
                finalPricePerSecond = dynamicPrice;
            } catch {
                // Use base price if dynamic pricing fails
                finalPricePerSecond = listing.pricePerSecond;
            }
        }

        uint256 totalCost = finalPricePerSecond * duration;

        // Calculate required collateral based on reputation
        uint256 requiredCollateral = _calculateRequiredCollateral(
            totalCost,
            listing.collateralMultiplier,
            msg.sender
        );

        require(msg.value >= totalCost + requiredCollateral, "Insufficient payment");
        require(
            userCollateralBalance[msg.sender] + msg.value >= requiredCollateral,
            "Insufficient collateral"
        );

        uint256 rentalId = nextRentalId++;
        uint256 startTime = block.timestamp;
        uint256 endTime = startTime + duration;

        // Create payment stream
        uint256 streamId = _createPaymentStream(
            listing.owner,
            startTime,
            endTime,
            totalCost
        );

        rentals[rentalId] = Rental({
            nftContract: listing.nftContract,
            tokenId: listing.tokenId,
            owner: listing.owner,
            renter: msg.sender,
            pricePerSecond: finalPricePerSecond,
            startTime: startTime,
            endTime: endTime,
            collateralAmount: requiredCollateral,
            streamId: streamId,
            state: RentalState.RENTED,
            createdAt: block.timestamp,
            lastUpdated: block.timestamp
        });

        userRentals[msg.sender].push(rentalId);

        // Set user for ERC-4907 compatible NFTs
        if (supportsInterface(listing.nftContract, type(IERC4907).interfaceId)) {
            IERC4907(listing.nftContract).setUser(listing.tokenId, msg.sender, uint64(endTime));
        }

        // Update state to ACTIVE
        rentals[rentalId].state = RentalState.ACTIVE;
        rentals[rentalId].lastUpdated = block.timestamp;

        // Store collateral
        userCollateralBalance[msg.sender] = userCollateralBalance[msg.sender] + requiredCollateral;

        // Deactivate listing temporarily
        listing.active = false;

        // Emit event
        _emitRentalStarted(rentalId, listing, msg.sender, duration, totalCost, streamId);
    }

    /**
     * @dev Helper function to emit rental started event
     */
    function _emitRentalStarted(
        uint256 rentalId,
        RentalListing memory listing,
        address renter,
        uint256 duration,
        uint256 totalCost,
        uint256 streamId
    ) internal {
        emit RentalStarted(rentalId, listing.nftContract, listing.tokenId, listing.owner, renter, duration, totalCost, streamId);
    }

    /**
     * @dev Complete a rental and handle final payments
     * @param rentalId The rental ID to complete
     */
    function completeRental(uint256 rentalId) external nonReentrant {
        Rental storage rental = rentals[rentalId];
        require(rental.state == RentalState.ACTIVE, "Rental not active");
        require(block.timestamp >= rental.endTime, "Rental not expired");
        require(
            msg.sender == rental.renter || 
            msg.sender == rental.owner || 
            msg.sender == owner(),
            "Not authorized"
        );

        rental.state = RentalState.COMPLETED;
        rental.lastUpdated = block.timestamp;

        // Finalize payment stream
        if (rental.streamId > 0) {
            PaymentStream(payable(paymentStreamContract)).finalizeStream(rental.streamId);
        }

        // Return collateral to renter
        if (rental.collateralAmount > 0) {
            userCollateralBalance[rental.renter] = userCollateralBalance[rental.renter] - rental.collateralAmount;
            payable(rental.renter).transfer(rental.collateralAmount);
        }

        // Clear user for ERC-4907 compatible NFTs
        if (supportsInterface(rental.nftContract, type(IERC4907).interfaceId)) {
            IERC4907(rental.nftContract).setUser(rental.tokenId, address(0), 0);
        }

        // Update reputation
        if (reputationContract != address(0)) {
            ReputationSystem(reputationContract).updateReputation(rental.renter, true);
            ReputationSystem(reputationContract).updateReputation(rental.owner, true);
        }

        // Record utility usage
        _recordUtilityUsage(rental);

        // Reactivate listing
        _reactivateListing(rental);

        uint256 totalPaid = rental.pricePerSecond * (rental.endTime - rental.startTime);
        emit RentalCompleted(rentalId, rental.renter, true, totalPaid);
    }

    /**
     * @dev Cancel a rental with fair fund distribution
     * @param rentalId The rental ID to cancel
     * @param reason Reason for cancellation
     */
    function cancelRental(uint256 rentalId, string calldata reason) external nonReentrant {
        Rental storage rental = rentals[rentalId];
        require(rental.state == RentalState.ACTIVE, "Rental not active");
        require(
            msg.sender == rental.renter || 
            msg.sender == rental.owner || 
            msg.sender == owner(),
            "Not authorized"
        );

        rental.state = RentalState.CANCELLED;
        rental.lastUpdated = block.timestamp;

        // Calculate pro-rata refund
        uint256 elapsedTime = block.timestamp - rental.startTime;
        uint256 totalDuration = rental.endTime - rental.startTime;
        uint256 usedAmount = rental.pricePerSecond * elapsedTime;
        uint256 refundAmount = (rental.pricePerSecond * totalDuration) - usedAmount;

        // Cancel payment stream and distribute funds
        if (rental.streamId > 0) {
            PaymentStream(payable(paymentStreamContract)).cancelStream(rental.streamId);
        }

        // Return unused payment to renter
        if (refundAmount > 0) {
            payable(rental.renter).transfer(refundAmount);
        }

        // Return collateral to renter
        if (rental.collateralAmount > 0) {
            userCollateralBalance[rental.renter] = userCollateralBalance[rental.renter] - rental.collateralAmount;
            payable(rental.renter).transfer(rental.collateralAmount);
        }

        // Clear user for ERC-4907 compatible NFTs
        if (supportsInterface(rental.nftContract, type(IERC4907).interfaceId)) {
            IERC4907(rental.nftContract).setUser(rental.tokenId, address(0), 0);
        }

        // Update reputation based on who cancelled
        if (reputationContract != address(0)) {
            bool isRenterFault = msg.sender == rental.renter;
            ReputationSystem(reputationContract).updateReputation(rental.renter, !isRenterFault);
            ReputationSystem(reputationContract).updateReputation(rental.owner, isRenterFault);
        }

        // Reactivate listing
        _reactivateListing(rental);

        emit RentalCancelled(rentalId, msg.sender, reason, refundAmount);
    }

    /**
     * @dev Calculate required collateral based on reputation
     */
    function _calculateRequiredCollateral(
        uint256 totalCost,
        uint256 baseMultiplier,
        address user
    ) internal view returns (uint256) {
        if (reputationContract == address(0)) {
            return totalCost * baseMultiplier / BASIS_POINTS;
        }

        uint256 reputationMultiplier = ReputationSystem(reputationContract).getCollateralMultiplier(user);

        // Use the higher of base multiplier or reputation-based multiplier
        uint256 finalMultiplier = baseMultiplier > reputationMultiplier ? baseMultiplier : reputationMultiplier;

        return totalCost * finalMultiplier / BASIS_POINTS;
    }

    /**
     * @dev Create payment stream for rental
     */
    function _createPaymentStream(
        address recipient,
        uint256 startTime,
        uint256 endTime,
        uint256 totalAmount
    ) internal view returns (uint256) {
        // This would interact with the PaymentStream contract
        // For now, return a mock stream ID
        return uint256(keccak256(abi.encodePacked(recipient, startTime, endTime, totalAmount, block.timestamp)));
    }

    /**
     * @dev Record utility usage for analytics
     */
    function _recordUtilityUsage(Rental memory rental) internal {
        if (utilityTrackerContract == address(0)) {
            return;
        }

        uint256 duration = rental.endTime - rental.startTime;
        uint256 utilityValue = rental.pricePerSecond * duration;

        (bool success, ) = utilityTrackerContract.call(
            abi.encodeWithSignature(
                "recordUtilityUsage(address,uint256,address,uint256,uint256,uint256,uint256)",
                rental.nftContract,
                rental.tokenId,
                rental.renter,
                rental.startTime,
                rental.endTime,
                0, // Gaming utility type
                utilityValue
            )
        );
        // Continue even if utility tracking fails
        success; // Silence unused variable warning
    }

    /**
     * @dev Reactivate listing after rental completion/cancellation
     */
    function _reactivateListing(Rental memory rental) internal {
        bytes32 listingId = keccak256(abi.encodePacked(rental.nftContract, rental.tokenId, rental.owner));
        if (listings[listingId].owner == rental.owner) {
            listings[listingId].active = true;
        }
    }

    /**
     * @dev Deposit collateral for future rentals
     */
    function depositCollateral() external payable {
        require(msg.value > 0, "Must deposit some amount");
        userCollateralBalance[msg.sender] = userCollateralBalance[msg.sender] + msg.value;
        emit CollateralDeposited(msg.sender, msg.value);
    }

    /**
     * @dev Withdraw available collateral
     * @param amount Amount to withdraw
     */
    function withdrawCollateral(uint256 amount) external nonReentrant {
        require(userCollateralBalance[msg.sender] >= amount, "Insufficient balance");
        userCollateralBalance[msg.sender] = userCollateralBalance[msg.sender] - amount;
        payable(msg.sender).transfer(amount);
        emit CollateralWithdrawn(msg.sender, amount);
    }

    /**
     * @dev Set creator royalty address for a collection
     * @param nftContract NFT contract address
     * @param creator Creator address
     */
    function setCreatorRoyalty(address nftContract, address creator) external onlyOwner {
        collectionCreators[nftContract] = creator;
        emit CreatorRoyaltySet(nftContract, creator);
    }

    /**
     * @dev Propose contract upgrade with timelock
     * @param newImplementation New implementation address
     */
    function proposeUpgrade(address newImplementation) external onlyOwner {
        require(newImplementation != address(0), "Invalid implementation");
        proposedImplementation = newImplementation;
        proposedUpgradeTime = block.timestamp + upgradeTimelock;
        emit UpgradeProposed(newImplementation, proposedUpgradeTime);
    }

    /**
     * @dev Execute contract upgrade after timelock
     */
    function executeUpgrade() external onlyOwner onlyAfterTimelock {
        require(proposedImplementation != address(0), "No upgrade proposed");
        _upgradeTo(proposedImplementation);
        emit UpgradeExecuted(proposedImplementation);
        proposedImplementation = address(0);
        proposedUpgradeTime = 0;
    }

    /**
     * @dev Check if a contract supports an interface
     */
    function supportsInterface(address contractAddr, bytes4 interfaceId) internal view returns (bool) {
        try IERC165(contractAddr).supportsInterface(interfaceId) returns (bool supported) {
            return supported;
        } catch {
            return false;
        }
    }

    /**
     * @dev Get rental details
     */
    function getRental(uint256 rentalId) external view returns (Rental memory) {
        return rentals[rentalId];
    }

    /**
     * @dev Get listing details
     */
    function getListing(bytes32 listingId) external view returns (RentalListing memory) {
        return listings[listingId];
    }

    /**
     * @dev Get rental state
     */
    function getRentalState(uint256 rentalId) external view returns (RentalState) {
        return rentals[rentalId].state;
    }

    /**
     * @dev Emergency pause function
     */
    function pause() external onlyOwner {
        _pause();
    }

    /**
     * @dev Unpause function
     */
    function unpause() external onlyOwner {
        _unpause();
    }

    /**
     * @dev Update platform fee
     */
    function updatePlatformFee(uint256 newFeePercentage) external onlyOwner {
        require(newFeePercentage <= 1000, "Fee too high"); // Max 10%
        platformFeePercentage = newFeePercentage;
    }

    /**
     * @dev Update creator royalty percentage
     */
    function updateCreatorRoyalty(uint256 newRoyaltyPercentage) external onlyOwner {
        require(newRoyaltyPercentage <= 500, "Royalty too high"); // Max 5%
        creatorRoyaltyPercentage = newRoyaltyPercentage;
    }

    /**
     * @dev Withdraw platform fees
     */
    function withdrawPlatformFees() external onlyOwner {
        payable(treasury).transfer(address(this).balance);
    }

    /**
     * @dev Required by UUPSUpgradeable
     */
    function _authorizeUpgrade(address newImplementation) internal override onlyOwner {}

    /**
     * @dev Receive function to accept ETH
     */
    receive() external payable {}
}

/**
 * @title IDynamicPricing
 * @dev Interface for dynamic pricing contract
 */
interface IDynamicPricing {
    function getDynamicPrice(
        address nftContract,
        uint256 tokenId,
        uint256 basePrice,
        address user
    ) external view returns (uint256);
}

contracts/PaymentStream.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/Pausable.sol";

/**
 * @title PaymentStream
 * @dev Enhanced contract for real-time payment streaming for NFT rentals
 * Implements continuous payment flow with platform fees and creator royalties
 * Designed for formal verification and security
 */
contract PaymentStream is ReentrancyGuard, Ownable, Pausable {

    struct Stream {
        address sender;
        address recipient;
        uint256 deposit;
        uint256 ratePerSecond;
        uint256 startTime;
        uint256 stopTime;
        uint256 remainingBalance;
        uint256 totalWithdrawn;
        bool active;
        bool finalized;
        uint256 platformFeeAmount;
        uint256 creatorRoyaltyAmount;
        address creatorAddress;
    }

    // State variables
    mapping(uint256 => Stream) public streams;
    mapping(address => uint256[]) public senderStreams;
    mapping(address => uint256[]) public recipientStreams;

    uint256 public nextStreamId;
    uint256 public constant MINIMUM_STREAM_DURATION = 1; // 1 second
    uint256 public constant BASIS_POINTS = 10000;

    // Fee structure
    uint256 public platformFeePercentage = 250; // 2.5%
    uint256 public creatorRoyaltyPercentage = 50; // 0.5% of total rental
    address public treasury;
    mapping(address => address) public collectionCreators; // NFT contract => creator address

    // Security features
    mapping(address => bool) public authorizedContracts;
    uint256 public maxStreamDuration = 30 days;

    // Events
    event StreamCreated(
        uint256 indexed streamId,
        address indexed sender,
        address indexed recipient,
        uint256 deposit,
        uint256 ratePerSecond,
        uint256 startTime,
        uint256 stopTime,
        uint256 platformFeeAmount,
        uint256 creatorRoyaltyAmount
    );

    event StreamWithdrawn(
        uint256 indexed streamId,
        address indexed recipient,
        uint256 amount,
        uint256 totalWithdrawn
    );

    event StreamCancelled(
        uint256 indexed streamId,
        address indexed sender,
        address indexed recipient,
        uint256 senderBalance,
        uint256 recipientBalance
    );

    event StreamFinalized(
        uint256 indexed streamId,
        uint256 totalPaid,
        uint256 platformFeeCollected,
        uint256 creatorRoyaltyCollected
    );

    event PlatformFeeWithdrawn(
        address indexed treasury,
        uint256 amount
    );

    event CreatorRoyaltyPaid(
        address indexed creator,
        uint256 amount
    );

    // Modifiers
    modifier onlyAuthorized() {
        require(
            authorizedContracts[msg.sender] || 
            msg.sender == owner(),
            "Not authorized"
        );
        _;
    }

    constructor(address _treasury) {
        treasury = _treasury;
    }

    /**
     * @dev Create a new payment stream with fee calculation
     * @param recipient Address to receive the stream
     * @param startTime When the stream starts (unix timestamp)
     * @param stopTime When the stream stops (unix timestamp)
     * @param nftContract NFT contract address for creator royalty calculation
     */
    function createStream(
        address recipient,
        uint256 startTime,
        uint256 stopTime,
        address nftContract
    ) external payable nonReentrant whenNotPaused returns (uint256 streamId) {
        require(recipient != address(0), "Invalid recipient");
        require(recipient != msg.sender, "Cannot stream to self");
        require(msg.value > 0, "Deposit must be greater than 0");
        require(startTime >= block.timestamp, "Start time in the past");
        require(stopTime > startTime, "Stop time before start time");

        uint256 duration = stopTime - startTime;
        require(duration >= MINIMUM_STREAM_DURATION, "Duration too short");
        require(duration <= maxStreamDuration, "Duration too long");

        // Calculate fees
        uint256 platformFeeAmount = msg.value * platformFeePercentage / BASIS_POINTS;
        uint256 creatorRoyaltyAmount = msg.value * creatorRoyaltyPercentage / BASIS_POINTS;
        uint256 netAmount = msg.value - platformFeeAmount - creatorRoyaltyAmount;

        uint256 ratePerSecond = netAmount / duration;
        require(ratePerSecond > 0, "Rate per second must be greater than 0");

        streamId = nextStreamId++;

        streams[streamId] = Stream({
            sender: msg.sender,
            recipient: recipient,
            deposit: netAmount,
            ratePerSecond: ratePerSecond,
            startTime: startTime,
            stopTime: stopTime,
            remainingBalance: netAmount,
            totalWithdrawn: 0,
            active: true,
            finalized: false,
            platformFeeAmount: platformFeeAmount,
            creatorRoyaltyAmount: creatorRoyaltyAmount,
            creatorAddress: collectionCreators[nftContract]
        });

        senderStreams[msg.sender].push(streamId);
        recipientStreams[recipient].push(streamId);

        emit StreamCreated(
            streamId,
            msg.sender,
            recipient,
            netAmount,
            ratePerSecond,
            startTime,
            stopTime,
            platformFeeAmount,
            creatorRoyaltyAmount
        );
    }

    /**
     * @dev Calculate the available balance for withdrawal
     * @param streamId The stream ID
     * @return The available balance
     */
    function balanceOf(uint256 streamId) external view returns (uint256) {
        Stream memory stream = streams[streamId];
        require(stream.sender != address(0), "Stream does not exist");

        if (block.timestamp <= stream.startTime) {
            return 0;
        }

        if (block.timestamp >= stream.stopTime) {
            return stream.remainingBalance;
        }

        uint256 elapsedTime = block.timestamp - stream.startTime;
        uint256 availableAmount = elapsedTime * stream.ratePerSecond;
        uint256 totalWithdrawn = stream.deposit - stream.remainingBalance;

        return availableAmount - totalWithdrawn;
    }

    /**
     * @dev Withdraw available funds from a stream with enhanced security
     * @param streamId The stream ID
     * @param amount Amount to withdraw (0 for all available)
     */
    function withdrawFromStream(uint256 streamId, uint256 amount) external nonReentrant whenNotPaused {
        Stream storage stream = streams[streamId];
        require(stream.recipient == msg.sender, "Not the recipient");
        require(stream.active && !stream.finalized, "Stream not active");

        uint256 availableBalance = this.balanceOf(streamId);
        require(availableBalance > 0, "No funds available");

        uint256 withdrawAmount = amount == 0 ? availableBalance : amount;
        require(withdrawAmount <= availableBalance, "Insufficient balance");
        require(withdrawAmount <= stream.remainingBalance, "Exceeds remaining balance");

        stream.remainingBalance = stream.remainingBalance - withdrawAmount;
        stream.totalWithdrawn = stream.totalWithdrawn + withdrawAmount;

        payable(msg.sender).transfer(withdrawAmount);

        emit StreamWithdrawn(streamId, msg.sender, withdrawAmount, stream.totalWithdrawn);
    }

    /**
     * @dev Release funds automatically (called by upkeeper bots)
     * @param streamId The stream ID
     */
    function releaseFunds(uint256 streamId) external nonReentrant {
        Stream storage stream = streams[streamId];
        require(stream.active && !stream.finalized, "Stream not active");
        require(block.timestamp >= stream.startTime, "Stream not started");

        uint256 availableBalance = this.balanceOf(streamId);
        if (availableBalance > 0) {
            stream.remainingBalance = stream.remainingBalance - availableBalance;
            stream.totalWithdrawn = stream.totalWithdrawn + availableBalance;

            payable(stream.recipient).transfer(availableBalance);

            emit StreamWithdrawn(streamId, stream.recipient, availableBalance, stream.totalWithdrawn);
        }
    }

    /**
     * @dev Finalize a stream and distribute remaining funds and fees
     * @param streamId The stream ID
     */
    function finalizeStream(uint256 streamId) external onlyAuthorized {
        Stream storage stream = streams[streamId];
        require(stream.active && !stream.finalized, "Stream not active");

        stream.active = false;
        stream.finalized = true;

        // Transfer any remaining balance to recipient
        if (stream.remainingBalance > 0) {
            payable(stream.recipient).transfer(stream.remainingBalance);
            stream.totalWithdrawn = stream.totalWithdrawn + stream.remainingBalance;
            stream.remainingBalance = 0;
        }

        // Distribute platform fee to treasury
        if (stream.platformFeeAmount > 0 && treasury != address(0)) {
            payable(treasury).transfer(stream.platformFeeAmount);
            emit PlatformFeeWithdrawn(treasury, stream.platformFeeAmount);
        }

        // Distribute creator royalty
        if (stream.creatorRoyaltyAmount > 0 && stream.creatorAddress != address(0)) {
            payable(stream.creatorAddress).transfer(stream.creatorRoyaltyAmount);
            emit CreatorRoyaltyPaid(stream.creatorAddress, stream.creatorRoyaltyAmount);
        }

        emit StreamFinalized(
            streamId,
            stream.totalWithdrawn,
            stream.platformFeeAmount,
            stream.creatorRoyaltyAmount
        );
    }


    /**
     * @dev Get stream details
     * @param streamId The stream ID
     * @return Stream struct
     */
    function getStream(uint256 streamId) external view returns (Stream memory) {
        return streams[streamId];
    }

    /**
     * @dev Get streams where user is sender
     * @param user User address
     * @return Array of stream IDs
     */
    function getSenderStreams(address user) external view returns (uint256[] memory) {
        return senderStreams[user];
    }

    /**
     * @dev Get streams where user is recipient
     * @param user User address
     * @return Array of stream IDs
     */
    function getRecipientStreams(address user) external view returns (uint256[] memory) {
        return recipientStreams[user];
    }

    /**
     * @dev Check if a stream is active and ongoing
     * @param streamId The stream ID
     * @return True if stream is active
     */
    function isStreamActive(uint256 streamId) external view returns (bool) {
        Stream memory stream = streams[streamId];
        return stream.active && 
               block.timestamp >= stream.startTime && 
               block.timestamp < stream.stopTime &&
               stream.remainingBalance > 0;
    }

    /**
     * @dev Get the current streaming rate for a stream
     * @param streamId The stream ID
     * @return Rate per second in wei
     */
    function getStreamRate(uint256 streamId) external view returns (uint256) {
        return streams[streamId].ratePerSecond;
    }

    /**
     * @dev Calculate total streamed amount so far
     * @param streamId The stream ID
     * @return Total amount streamed
     */
    function getTotalStreamed(uint256 streamId) external view returns (uint256) {
        Stream memory stream = streams[streamId];
        require(stream.sender != address(0), "Stream does not exist");

        if (block.timestamp <= stream.startTime) {
            return 0;
        }

        uint256 endTime = block.timestamp >= stream.stopTime ? stream.stopTime : block.timestamp;
        uint256 elapsedTime = endTime - stream.startTime;

        return elapsedTime * stream.ratePerSecond;
    }

    /**
     * @dev Cancel a stream and return remaining funds with pro-rata distribution
     * @param streamId The stream ID
     */
    function cancelStream(uint256 streamId) external nonReentrant {
        Stream storage stream = streams[streamId];
        require(
            stream.sender == msg.sender || 
            stream.recipient == msg.sender ||
            authorizedContracts[msg.sender],
            "Not authorized"
        );
        require(stream.active && !stream.finalized, "Stream not active");

        uint256 availableToRecipient = this.balanceOf(streamId);
        uint256 remainingToSender = stream.remainingBalance - availableToRecipient;

        stream.active = false;
        stream.finalized = true;
        stream.remainingBalance = 0;

        if (availableToRecipient > 0) {
            payable(stream.recipient).transfer(availableToRecipient);
        }

        if (remainingToSender > 0) {
            payable(stream.sender).transfer(remainingToSender);
        }

        emit StreamCancelled(
            streamId,
            stream.sender,
            stream.recipient,
            remainingToSender,
            availableToRecipient
        );
    }

    /**
     * @dev Set creator address for a collection
     * @param nftContract NFT contract address
     * @param creator Creator address
     */
    function setCollectionCreator(address nftContract, address creator) external onlyOwner {
        collectionCreators[nftContract] = creator;
    }

    /**
     * @dev Update platform fee percentage
     * @param newFeePercentage New fee percentage in basis points
     */
    function updatePlatformFee(uint256 newFeePercentage) external onlyOwner {
        require(newFeePercentage <= 1000, "Fee too high"); // Max 10%
        platformFeePercentage = newFeePercentage;
    }

    /**
     * @dev Update creator royalty percentage
     * @param newRoyaltyPercentage New royalty percentage in basis points
     */
    function updateCreatorRoyalty(uint256 newRoyaltyPercentage) external onlyOwner {
        require(newRoyaltyPercentage <= 500, "Royalty too high"); // Max 5%
        creatorRoyaltyPercentage = newRoyaltyPercentage;
    }

    /**
     * @dev Update treasury address
     * @param newTreasury New treasury address
     */
    function updateTreasury(address newTreasury) external onlyOwner {
        require(newTreasury != address(0), "Invalid treasury address");
        treasury = newTreasury;
    }

    /**
     * @dev Add authorized contract
     * @param contractAddr Contract address to authorize
     */
    function addAuthorizedContract(address contractAddr) external onlyOwner {
        authorizedContracts[contractAddr] = true;
    }

    /**
     * @dev Remove authorized contract
     * @param contractAddr Contract address to remove
     */
    function removeAuthorizedContract(address contractAddr) external onlyOwner {
        authorizedContracts[contractAddr] = false;
    }

    /**
     * @dev Update maximum stream duration
     * @param newMaxDuration New maximum duration in seconds
     */
    function updateMaxStreamDuration(uint256 newMaxDuration) external onlyOwner {
        require(newMaxDuration >= MINIMUM_STREAM_DURATION, "Duration too short");
        maxStreamDuration = newMaxDuration;
    }

    /**
     * @dev Emergency pause function
     */
    function pause() external onlyOwner {
        _pause();
    }

    /**
     * @dev Unpause function
     */
    function unpause() external onlyOwner {
        _unpause();
    }

    /**
     * @dev Emergency function to recover stuck funds (only owner)
     * @param streamId The stream ID
     */
    function emergencyWithdraw(uint256 streamId) external onlyOwner {
        Stream storage stream = streams[streamId];
        require(stream.remainingBalance > 0, "No balance to withdraw");

        uint256 amount = stream.remainingBalance;
        stream.remainingBalance = 0;
        stream.active = false;
        stream.finalized = true;

        payable(owner()).transfer(amount);
    }

    /**
     * @dev Get comprehensive stream information
     * @param streamId The stream ID
     * @return Stream struct with all details
     */
    function getStreamDetails(uint256 streamId) external view returns (Stream memory) {
        return streams[streamId];
    }

    /**
     * @dev Get total platform fees collected
     * @return Total platform fees in contract
     */
    function getTotalPlatformFees() external view returns (uint256) {
        uint256 totalFees = 0;
        for (uint256 i = 0; i < nextStreamId; i++) {
            if (streams[i].finalized) {
                totalFees += streams[i].platformFeeAmount;
            }
        }
        return totalFees;
    }

    /**
     * @dev Get total creator royalties collected
     * @return Total creator royalties in contract
     */
    function getTotalCreatorRoyalties() external view returns (uint256) {
        uint256 totalRoyalties = 0;
        for (uint256 i = 0; i < nextStreamId; i++) {
            if (streams[i].finalized) {
                totalRoyalties += streams[i].creatorRoyaltyAmount;
            }
        }
        return totalRoyalties;
    }

    /**
     * @dev Withdraw accumulated platform fees
     */
    function withdrawPlatformFees() external onlyOwner {
        require(treasury != address(0), "Treasury not set");
        uint256 balance = address(this).balance;
        require(balance > 0, "No funds to withdraw");

        payable(treasury).transfer(balance);
        emit PlatformFeeWithdrawn(treasury, balance);
    }

    /**
     * @dev Receive function to accept ETH
     */
    receive() external payable {}
}

